import { SEARCH_WITH_NAME } from "../Constants/UserConstants";

export const Search_reducer =(state,dispatch)=>{
switch (dispatch.type) {
    case SEARCH_WITH_NAME:
        state.name=dispatch.payload
        return {...state, state:state.name}

    default:
        return state;
}
}
